import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { cartStore} from './CartStore';
import { usePopup } from './PopupProvider';
import './Stores.css';  
const GoldaMenu = () => {
  const navigate = useNavigate();
  const { setImages, setVisible } = usePopup();

  const menu = [
    { name: 'Vanilla Ice Cream', price: 18 ,images:["data:image/jpeg;base64,"]},
    { name: 'Chocolate Ice Cream', price: 18 ,images:["data:image/jpeg;base64,"]},
    { name: 'Loacker Ice Cream', price: 18 ,images:["data:image/jpeg;base64,"]},
    { name: 'Cookies and Cream Ice Cream', price: 20 ,images:["data:image/jpeg;base64,"]},
    { name: 'Cookie Dough', price: 22,images:["https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQF2tOJinm7q_pYdKgeKsfG5yiONysMYb5utg&s"] },
    { name: 'Salted Bagel', price: 22 ,images:["data:image/jpeg;base64,"]},
    { name: 'Pistachio Ice Cream', price: 25,images:["data:image/jpeg;base64,"]},
    { name: 'Mango Sorbet', price: 20 ,images:["data:image/jpeg;base64,"]},
    { name: 'Lemon Sorbet', price: 18,images:["data:image/jpeg;base64,"] },
    { name: 'Dark Chocolate Sorbet', price: 20,images:["data:image/jpeg;base64,"] },
  ];

  const goToCart = () => {
    navigate('/cart');
  };

  const handleImage = (images) => {
    setVisible(true);
    setImages(images);
  };

  return (
    <div className="menu-container Golda-menu-container">
      <h2>Golda Ice Cream Menu</h2>
      <ul>
        {menu.map((item, index) => (
          <li key={index}>
            {item.name} - {item.price} ₪
            <div className="resButtons">
              
              <button onClick={() => handleImage(item.images || [])}>צפה במוצר</button>
              <button onClick={() => cartStore.addItem(item)}>+</button>
            </div>
          </li>
        ))}
      </ul>
      <button className="go-to-cart-button" onClick={goToCart}>Go to Cart</button>
    </div>
  );
};

export default GoldaMenu;
